```
const arr = ["dog", "cat", "apple", "banana"];
arr = sortStrings(arr);
console.log(arr); // Output: ["apple", "banana", "cat", "dog"]
```
Note that this function is case-sensitive, so uppercase letters will come before lowercase letters. If you want a case-insensitive sort, you can modify the compare function to use `a.localeCompare(b, 'en', { sensitivity: 'base' })`, which ignores case.

Alternatively, you can also use the `Intl.Collator` API to sort strings in alphabetical order, like this:
```
