Here is a JavaScript code snippet for an interactive web page element that displays a dropdown menu when clicked:
```
// Create a dropdown menu element
const dropdownMenu = document.createElement("div");
dropdownMenu.className = "dropdown-menu";

// Create a button to trigger the dropdown menu
const dropdownButton = document.createElement("button");
dropdownButton.textContent = "Menu";
dropdownButton.addEventListener("click", () => {
  // Toggle the visibility of the dropdown menu
  dropdownMenu.classList.toggle("show");
});

// Create list items for the dropdown menu
const listItemHome = document.createElement("li");
listItemHome.textContent = "Home";

const listItemAbout = document.createElement("li");
listItemAbout.textContent = "About";

const listItemContact = document.createElement("li");
listItemContact.textContent = "Contact";

// Add list items to the dropdown menu
dropdownMenu.appendChild(listItemHome);
dropdownMenu.appendChild(listItemAbout);
dropdownMenu.appendChild(listItemContact);

// Add the button and dropdown menu to the page
document.body.appendChild(dropdownButton);
document.body.appendChild(dropdownMenu);
```
**How to integrate with HTML and CSS:**

1. **HTML:** Create a container element (e.g., `div`) in your HTML file where you want the dropdown menu to appear. Give it an ID or class that can be targeted by JavaScript.
```html
<!-- index.html -->
<div id="dropdown-container"></div>
```
2. **JavaScript:** Update the code to target the container element:
```javascript
// Get the container element
const container = document.getElementById("dropdown-container");

// Add the button and dropdown menu to the container
container.appendChild(dropdownButton);
container.appendChild(dropdownMenu);
```
