```cpp
#include <iostream>

class ArrayHandler {
private:
    int* arr;
    int size;

public:
    ArrayHandler(int s) : size(s) {
        // Allocate dynamic memory for array
        arr = new int[size];
    }

    ~ArrayHandler() {
        // Deallocate dynamic memory
        delete[] arr;
    }

    void fillArray() {
        for (int i = 0; i < size; ++i) {
            arr[i] = i * 2; // Fill array with numbers
        }
    }

    void printArray() {
        for (int i = 0; i < size; ++i) {
            std::cout << "arr[" << i << "] = " << arr[i] << std::endl;
        }
    }
};

int main() {
    ArrayHandler handler(5);
    handler.fillArray();
    handler.printArray();

    return 0;
}
```

In this program, we have a class `ArrayHandler` that dynamically allocates an array of integers in its constructor. The size of the array is specified when creating an instance of `ArrayHandler`.

The `fillArray` method fills the array with numbers (in this case, even numbers from 0 to 8), and the `printArray` method prints out the contents of the array.

In the destructor (`~ArrayHandler()`), we deallocate the dynamic memory using `delete[]`. This is necessary because C++ does not have a garbage collector, so we must manually free up any dynamically allocated memory when it's no longer needed to prevent memory leaks.

The `main` function demonstrates how to use `ArrayHandler`. It creates an instance of `ArrayHandler`, fills the array with numbers, and then prints out the contents of the array.

