* We display a Toast message using `Toast.makeText()`, passing in the `MyApplication.context` (which should be replaced with your app's application context), the reversed string, and `Toast.LENGTH_SHORT` for the duration.

Note that you'll need to replace `MyApplication.context` with your app's actual application context. You can do this by creating a companion object or singleton class in your app, like this:
